using AutoMapper;
using Business.Dtos.Product;
using Business.Services.Concrete;
using Business.Wrappers;
using Common.Exceptions;
using Data.Repositories.Abstract;
using Data.UnitOfWork;
using Moq;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace UnitTest.Services.Product
{
    public class UpdateProductServiceTests
    {
        private readonly Mock<IProductRepository> _productRepository;
        private readonly Mock<IMapper> _mapper;
        private readonly Mock<IUnitOfWork> _unitOfWork;
        private readonly ProductService _handler;
        public UpdateProductServiceTests()
        {
            _productRepository = new Mock<IProductRepository>();
            _mapper = new Mock<IMapper>();
            _unitOfWork = new Mock<IUnitOfWork>();
            _handler = new ProductService(_productRepository.Object, _unitOfWork.Object, _mapper.Object);
        }

        [Fact]
        public async Task Service_WhenProductNotFound_ShouldThrowValidationException()
        {
            var request = new ProductUpdateDto
            {
                Name = "name",
                Description = "description description",
                Photo = "",
                Price = 1,
                Quantity = 1,
                Type = Common.Constants.ProductType.Sold
            };
            //Arrange
            _productRepository.Setup(x => x.GetAsync(3)).ReturnsAsync(value: null);

            //Act
            Func<Task> func = async () => await _handler.UpdateProductAsync(3, request);

            //Assert
            var exception = await Assert.ThrowsAsync<ValidationException>(func);
            Assert.Contains("Product not found", exception.Errors);
        }

        [Fact]
        public async Task Service_WhenValidationIsFailed_ShouldThrowValidationException()
        {
            //Arrange
            var request = new ProductUpdateDto
            {
                Name = "name",
                Description = "description description",
                Photo = "",
                Price = 0,
                Quantity = 1,
                Type = Common.Constants.ProductType.Sold
            };
            _productRepository.Setup(x => x.GetAsync(3)).ReturnsAsync(new Common.Entities.Product());

            //Act
            Func<Task> func = async () => await _handler.UpdateProductAsync(3, request);

            //Assert
            var exception = await Assert.ThrowsAsync<ValidationException>(func);
            Assert.Contains("Price can't be zero", exception.Errors);
        }

        [Fact]
        public async Task Service_WhenFlowIsSucceded_ShouldReturnResponse()
        {
            //Arrange
            var request = new ProductUpdateDto
            {
                Name = "name",
                Description = "description description",
                Photo = "",
                Price = 1,
                Quantity = 1,
                Type = Common.Constants.ProductType.Sold
            };
            var product = _productRepository.Setup(x => x.GetAsync(3)).ReturnsAsync(new Common.Entities.Product());
            _mapper.Setup(x => x.Map(request, product));

            //Act
            var response = await _handler.UpdateProductAsync(3, request);

            //Assert
            Assert.IsType<Response>(response);
            Assert.Contains("Product updated succesfully", response.Message);
        }

    }
}
